/* 
Given a string, find the first non-repeating character in it and return its index. If it doesn't exist, return -1.

Constraints
    1 <= s.length <= 105
    s consists of only lowercase English letters.
*/

/**
 * @param {string} s
 * @return {number}
 **/

/* 
Plan
Use a Map to iterate through the string.
At each index of the string, store the current index, the letter, and the count of how many times the letter appears in the string.

*/

